import "./HomePage.scss";
import ImageList from "../components/Image/ImageList";
import axios from "axios";
import { API } from "../api/API.js";

function HomePage() {
  const getUser = () => {
    axios
      .get(API + "/getallusers")
      .then((res) => {
        console.log(res);
      })
      .catch((err) => console.log(err));
  };

  return (
    <main>
      {getUser}
      <ImageList />
    </main>
  );
}

export default HomePage;
